static void
_serial_interface_on_signal_broadcast_caninfo (
    SerialInterface *object,
    const gchar *arg_candata,
    guchar arg_len)
{
  SerialInterfaceSkeleton *skeleton = SERIAL_INTERFACE_SKELETON (object);

  GList      *connections, *l;
  GVariant   *signal_variant;
  connections = g_dbus_interface_skeleton_get_connections (G_DBUS_INTERFACE_SKELETON (skeleton));

  signal_variant = g_variant_ref_sink (g_variant_new ("(^ayy)",
                   arg_candata,
                   arg_len));
  for (l = connections; l != NULL; l = l->next)
    {
      GDBusConnection *connection = l->data;
      g_dbus_connection_emit_signal (connection,
        NULL, g_dbus_interface_skeleton_get_object_path (G_DBUS_INTERFACE_SKELETON (skeleton)), "Serial.interface", "broadcastCANInfo",
        signal_variant, NULL);
    }
  g_variant_unref (signal_variant);
  g_list_free_full (connections, g_object_unref);
}

